(function($){
  $( document ).ready(function() {

    var menuBgSwiper = new Swiper('.menu-bg-slider', {
      effect: 'fade',
      slidesPerView: 1,
      speed: 400
    });
    var menuSwiper = new Swiper('.menu-slider', {
      // Optional parameters
      direction: 'vertical',
      centeredSlides: true,
      loop: true,
      mousewheel: true,
      speed: 400,
      grabCursor: true,
      autoHeight: true,
      spaceBetween: 0,
      slidesPerView: 3,
      breakpoints: {
        // when window width is >= 576px
        576: {
          slidesPerView: 5,
        },
        // when window width is >= 992px
        992: {
          slidesPerView: 3,
        },
        // when window width is >= 1600px
        1600: {
          slidesPerView: 5,
        }
      },
      thumbs: {
        swiper: menuBgSwiper
      }
    });
    const swup = new Swup();
    swupLoaded();
    visibleContent();
    swup.on('contentReplaced', function() {
      googleAnalytics();
      document.body.scrollTop = 0; //Zero is the pixels from the top of the screen
      document.documentElement.scrollTop = 0;
      swupLoaded();
      visibleContent();
    });
    swup.on('popState', function() {
      $("html").removeClass("loaded");
    });
    swup.on('animationInStart', function() {
      $("html").removeClass("loaded");
    });

  });
  $(window).on("load", function(){

  });
  $(window).on("scroll", function() {
    visibleContent();
    var scrollPixels = $(window).scrollTop();
    var newWidth = 100 - (scrollPixels / 60);
    $('.paragraph-image-with-overlay.visible:first-child .background').css('width',newWidth+'%');
  });
  swupLoaded = function() {
    $('[data-toggle="tooltip"]').tooltip({
      trigger: "manual",
      placement: 'bottom'
    })
    var clipboard = new ClipboardJS('.share-button');
    clipboard.on('success', function(e) {
      // console.log(e);
      // $('#share_link').addClass('copied');
      // setTimeout(function () {
      //   $('#share_link').removeClass('copied');
      // }, 300);
      $('#share_link').tooltip('show');
      setTimeout(function () {
        $('#share_link').tooltip('hide');
      }, 500);
    });
    clipboard.on('error', function(e) {
      // console.log(e);
    });
    if (!ClipboardJS.isSupported()) {
      $('.paragraph-share').remove();
    }
    // $("html").removeClass("loaded");
    setTimeout(function () {
      $("html").addClass("loaded");
    }, 500);
    if ($('.front-slider .swiper-wrapper .swiper-slide').length > 0) {
      var front_slider_count = $('.front-slider .swiper-wrapper .swiper-slide').length;
      if (front_slider_count < 10) {
        var front_slider_total = '0' + front_slider_count;
      } else {
        var front_slider_total = front_slider_count;
      }
      $('.slider-progress-total').text(front_slider_total);
      $('.slider-progress .progressbar').css('width', (100 / front_slider_total)+'%');
    }
    if ($('.front-intro').length == 0) {
      $('body').removeClass('front-slide-active');
    }
    setTimeout(function () {
      $('.front-intro, .front-slider-wrapper').addClass('slide-up');
      if ($('.front-intro').length) {
        setTimeout(function () {
          $('body').addClass('front-slide-active');
        }, 2000);
      }
      var frontSwiperNav = new Swiper ('.slider-progress-number', {
        effect: 'fade',
        slidesPerView: 1
      });
      var frontSwiper = new Swiper ('.front-slider', {
        // Optional parameters
        direction: 'vertical',
        loop: true,
        mousewheel: true,
        speed: 800,
        grabCursor: true,
        thumbs: {
          swiper: frontSwiperNav
        },
        on: {
          init: function () {
            var slideCustomIndex = 1;
            $('.front-slider .swiper-slide').each(function(){
              if ($(this).find('.parallax').length) {
                $(this).find('.parallax').attr('id','scene-'+slideCustomIndex);
                sceneId = 'scene-'+slideCustomIndex;
                var scene = document.getElementById(sceneId);
                var parallaxInstance = new Parallax(scene);
              }
              slideCustomIndex = slideCustomIndex+1;
            });
          },
          slideChange: function () {
            currentSlideIndex = frontSwiper.realIndex+1;
            var progress_percentage = 100 / front_slider_count * currentSlideIndex;
            $('.slider-progress .progressbar').css('width', progress_percentage+'%');
            setTimeout(function () {
              $('body').removeClass('front-slide-active');
            }, 500);
            setTimeout(function () {
              $('body').addClass('front-slide-active');
            }, 2000);
          },
        }
      });
    }, 9000);
    setTimeout(function () {
      $('.paragraph-slides').each(function(){
        if ($(this).find('.slider-wrapper .swiper-wrapper .swiper-slide').length > 1) {
          slideNav = $(this).find('.slider-navigation');
          slideWrap = $(this).find('.slider-wrapper');
          slideWrapNext = $(this).find('.slider-next');
          slideWrapPrev = $(this).find('.slider-prev');
          var infoSwiperNav = new Swiper (slideNav, {
            slidesPerView: 5
          });
          var infoSwiper = new Swiper (slideWrap, {
            // Optional parameters
            loop: true,
            speed: 800,
            grabCursor: true,
            thumbs: {
              swiper: infoSwiperNav
            },
            navigation: {
              nextEl: slideWrapNext,
              prevEl: slideWrapPrev
            }
          });
        } else {
          $(this).find('.swiper-button-wrapper').remove();
          $(this).find('.slider-wrapper').addClass('swiper-container-initialized');
          $(this).find('.slider-navigation .swiper-slide').addClass('swiper-slide-thumb-active');
        }
      });
      $('.paragraph-image').each(function(){
        if ($(this).find('.slider-wrapper .swiper-wrapper .swiper-slide').length > 1) {
          slideWrap = $(this).find('.slider-wrapper');
          slideWrapNext = $(this).find('.slider-next');
          slideWrapPrev = $(this).find('.slider-prev');
          var infoSwiper = new Swiper (slideWrap, {
            // Optional parameters
            loop: true,
            speed: 800,
            grabCursor: true,
            navigation: {
              nextEl: slideWrapNext,
              prevEl: slideWrapPrev
            }
          });
        } else {
          $(this).find('.swiper-button-wrapper').remove();
          $(this).find('.slider-wrapper').addClass('swiper-container-initialized');
        }
      });
    }, 500);
    $('.navigation-menu.front a').attr('data-swup-transition', 'infopage-from-slider');
    var currentPath = location.pathname;
    $('.navigation-menu.subpage li, .navigation-menu.subpage li a').removeClass("active");
    $('.navigation-menu.subpage a[href="'+currentPath+'"]').addClass("active").parent().addClass("active");
    if ($('.navigation-menu.subpage ul li.active').next('li').find('a').attr('href') == undefined) {
      var nextChapter = $('.navigation-menu.subpage ul li').first().find('a').attr('href');
    } else {
      var nextChapter = $('.navigation-menu.subpage ul li.active').next('li').find('a').attr('href');
    }
    if ($('.navigation-menu.subpage ul li.active').prev('li').find('a').attr('href') == undefined) {
      var prevChapter = $('.navigation-menu.subpage ul li').last().find('a').attr('href');
    } else {
      var prevChapter = $('.navigation-menu.subpage ul li.active').prev('li').find('a').attr('href');
    }
    $('.navigation-menu.subpage div').prepend('<a href="'+prevChapter+'" class="prev-chapter"><i class="fa fa-angle-left"></i></div>');
    $('.navigation-menu.subpage div').append('<a href="'+nextChapter+'" class="next-chapter"><i class="fa fa-angle-right"></i></div>');
    // console.log(nextChapter);
    // console.log(prevChapter);
  }
  visibleContent = function() {
    $('.paragraph').each(function() {
      if ($(this).visible(true)) {
        $(this).addClass('visible');
      } else {
        $(this).removeClass('visible');
      }
    });
    if ($('.node__footer').visible(true)) {
      $('.node__footer').addClass('visible');
    }
  }
  $(document).on("click", ".scroll-down", function() {
    $([document.documentElement, document.body]).animate({
        scrollTop: $(this).offset().top + 68
    }, 1000);
  });
  $(document).on("click", "#menu-trigger", function() {
    if ($(this).hasClass("active")) {
      $(this).removeClass('active');
      $('body').removeClass('mega-menu-active');
    } else {
      $(this).addClass('active');
      $('body').addClass('mega-menu-active');
    }
  });
  $(document).on("click", "#mega-menu .title a, .mega-menu-active a.logo", function() {
    $('#menu-trigger').removeClass('active');
    $('body').removeClass('mega-menu-active');
  });
  $(document).on("click", ".front-slider .swiper-slide .call2action a", function() {
    setTimeout(function () {
      $('body').removeClass('front-slide-active');
    }, 1000);
  });
  $(document).on("click", ".node__footer a", function() {
    setTimeout(function () {
      $('body').addClass('front-slide-active');
    }, 700);
  });

  function googleAnalytics() {
    var path = (window.location.href).replace(window.location.origin, '').toLowerCase();
    window.dataLayer = window.dataLayer || [];
    function gtag() { dataLayer.push(arguments); }
    gtag('js', new Date());
    gtag('config', 'UA-41709723-7', {
      'anonymize_ip': true, // for GDPR
      'page_title': document.title,
      'page_path': path
    });
  }

})(jQuery);
;
